export const formatmacdData = (data) => {
    let finalData = {
      labels: [],
      datasets: [
        {
          label: "Price",
          data: [],
          backgroundColor: "rgb(10, 10, 10)",
          borderColor: "rgba(200, 200, 200)",
          fill: false
        }
      ]
    };

    let dates = data.map((val) => {
      let final = val["date"];
      return final;
    });

    let priceArr = data.map((val) => {
      return val[4];
    });

    priceArr.reverse();
    dates.reverse();
    finalData.labels = dates;
    finalData.datasets[0].data = priceArr;

    return finalData;
  };
